import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Admin = () => {
    const [flightsCount, setFlightsCount] = useState(0);
    const [bookingsCount, setBookingsCount] = useState(0);
    const navigate = useNavigate();

    useEffect(() => {
        // Fetch flights to get real count
        axios.get('http://localhost:6001/fetch-flights')
            .then(res => setFlightsCount(res.data.length))
            .catch(err => console.log(err));

        // Fetch bookings to get real count
        axios.get('http://localhost:6001/fetch-bookings')
            .then(res => setBookingsCount(res.data.length))
            .catch(err => console.log(err));
    }, []);

    return (
        <div className="admin-dashboard-container">
            <div className="card">
                <h3>Bookings</h3>
                <p>{bookingsCount}</p>
                <button className="btn btn-primary" onClick={() => navigate('/all-bookings')}>View all</button>
            </div>
            <div className="card">
                <h3>Flights</h3>
                <p>{flightsCount}</p>
                <button className="btn btn-primary" onClick={() => navigate('/flights')}>View all</button>
            </div>
            <div className="card">
                <h3>New Flight</h3>
                <p>(new route)</p>
                <button className="btn btn-primary" onClick={() => navigate('/add-flight')}>Add now</button>
            </div>
        </div>
    );
};

export default Admin;
